import { UserProvider } from "./context/userContext";
import Home from './components/Home';
import { AuthProvider } from 'react-auth-kit'
import {BrowserRouter,Routes,Route } from "react-router-dom";

const App = () => {
    return (
        <BrowserRouter>
            <Routes>
                <UserProvider>
                    <AuthProvider>
                        <Route path="/" element={<Home />} />
                    </AuthProvider>
                </UserProvider>
            </Routes>
        </BrowserRouter>
    )
}

export default App;
